package com.logibeat.cloud.common.vo;/** * Created by Yujinjun on 2016/10/27. */public class CarShareListVo {    private String logo;    private String name;    private String phone;    private String endTime;    private String shareId;    private Integer shareType;    private String carId;    private String entId;    private String perId;    public String getEntId() {        return entId;    }    public void setEntId(String entId) {        this.entId = entId;    }    public String getPerId() {        return perId;    }    public void setPerId(String perId) {        this.perId = perId;    }    public String getLogo() {        return logo;    }    public void setLogo(String logo) {        this.logo = logo;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public String getEndTime() {        return endTime;    }    public void setEndTime(String endTime) {        this.endTime = endTime;    }    public String getShareId() {        return shareId;    }    public void setShareId(String shareId) {        this.shareId = shareId;    }    public Integer getShareType() {        return shareType;    }    public void setShareType(Integer shareType) {        this.shareType = shareType;    }    public String getCarId() {        return carId;    }    public void setCarId(String carId) {        this.carId = carId;    }}